import BackButton from "../atoms/backButton";
import LogoButton from "../atoms/logoButton";

const TopButtonGroup = () => {
    return(
        <div className='topBar'>
            <div className='mr-auto pl-2 pt-1'>
                <BackButton />
            </div>
            <div className='mr-auto'>
                <LogoButton />
            </div>
        </div>
    )
}
export default TopButtonGroup;
